import { useAmp } from 'next/amp';

import Page from '../components/page';
import Footer from '../components/footer';
import ListProperty from '../components/listProperty';
import fetch from 'node-fetch'
import { fetcher } from '../shared/globalFunc';

export default (props) => {
  const isAmp = useAmp();

  return (
    <Page title="Next.js by ZEIT - The React Framework">
        <ListProperty listing={props.listing}/>
        <Footer />
    </Page>
  );
};

export async function getStaticProps(){
    const res = await fetcher('http://localhost:3000/api/getListings')
    const post = await res.json();
    console.log("res", typeof post )
    return {
        props: {listing: post.data}
    }
}
